// TestSum224 tests against reference hashes generated with `b2sum` (see: https://www.gnu.org/software/coreutils/b2sum).
func TestSum224(t *testing.T) {
	for i := range inputs {
		in := inputs[i]
		actual, err := Sum224(in)
		require.NoError(t, err, "unexpected error when computing blake2b224 hash")
		require.Equal(t, expectedHashes[i], actual, "resulting blake2b224 hash is not as expected")
	}
}

